  render() {
    return (
      <div className="App">
        <header class="hero is-info is-large">
  <div class="hero-body">
  <img src={BeachPic} alt="beach"/>

    <div class="container">

      <h1 class="title">
        Large title
      </h1>
      <h2 class="subtitle">
        Large subtitle
      </h2>
    </div>
  </div>
</header>
      </div>
    );
  }
}

export default App;
